(63, 'terms', '<h1>Agreement</h1>\r\n\r\n<p>The websites specialtyfood.com and my.fancyfoodshows.com (each a &ldquo;Website&rdquo; and together, the &ldquo;Websites&rdquo;) are owned and operated by the Specialty Food Association (&ldquo;SFA&rdquo;). Any visit to or use of the Websites by you constitutes your agreement that such visit or use is subject to these Terms and Conditions. The SFA reserves the right to change these Terms and Conditions at any time, and you are responsible for regularly reviewing these Terms and Conditions if you wish to continue using the Websites. Please read them carefullysss.</p>\r\n\r\n<h2>Privacy Notice</h2>\r\n\r\n<p>Please review our&nbsp;<strong><a href=\"https://www.specialtyfood.com/specialty-food-association/about-us/privacy-policy/\">Privacy Notice</a></strong>, which also governs your use of the Websites and our management of any personal information you may disclose to us while using the Websites.</p>\r\n\r\n<h2>Ownership and Copyright</h2>\r\n\r\n<p>All content on the Websites, such as text, graphics, logos, button icons, images, audio clips, digital downloads, data compilations, and software, is the property of the SFA, its members or its content suppliers. The compilation of all content on the Websites is the exclusive property of the SFA. All software used on the Websites is the property of the SFA or its software suppliers. All such content and software are protected by domestic and international copyright and other laws.</p>\r\n\r\n<h2>Limited License</h2>\r\n\r\n<p>Subject to the following, the SFA grants you a limited license to access and make personal use of the Websites solely for the purposes for which they were intended.</p>\r\n\r\n<p>You may not use the Websites for any other purpose without the express written consent of the SFA. You may not download (other than page caching), reproduce, duplicate, copy or modify any portion of the Websites. The use of spiders, robots, scrapers or any other means, whether through the use of automated software or through a physical or mechanical system, is strictly prohibited. You may not frame or utilize framing techniques to enclose any trademark, logo, or other proprietary information (including images, text and page layout) of the SFA or its members without the express written consent of the SFA or its members. You may not use any meta tags or any other &ldquo;hidden text&rdquo; utilizing the name or trademarks of the SFA or its members without the express written consent of the SFA or its members.</p>\r\n\r\n<p>Any unauthorized use of the Websites or violation of any of the foregoing terms shall result in the automatic termination of the foregoing limited license.</p>\r\n\r\n<h2>Registered Users</h2>\r\n\r\n<p>As a registered user of the Websites you may set up a personal dashboard on the Websites for the purpose of enhancing your ability to obtain information regarding the SFA, its members and members&rsquo; products, and to communicate with the SFA and its members. You may enter personal information and preferences on your dashboard in order to enhance your Website experience. The information on your personal dashboard may not be viewed or accessed by SFA members or other Website users. You may choose at any time to not allow SFA members to contact you via your personal dashboard.</p>\r\n\r\n<p>As a registered user of the Websites you may also set up a user profile for the purpose of participating in interactive forums with other registered users. You may enter personal information in your user profile in order to identify and describe yourself to other participants in the interactive forums. The information in your user profile may be viewed by other registered users.</p>\r\n\r\n<p>As a registered user of the Websites, you are responsible for maintaining the confidentiality of your personal dashboard, your account, your user password, and for restricting access to your computer, and you agree to accept responsibility for all activities that occur under your account or user profile or on your dashboard. You may not use a false e-mail address, impersonate any person or entity, or otherwise mislead as to the origin any information or content provided by you on your personal dashboard, in your user profile, or on the Websites. You may use your personal dashboard and user profile solely for the purposes for which they were intended. Any unauthorized use is prohibited.</p>\r\n\r\n<h2>Anticompetitive Behavior</h2>\r\n\r\n<p>Users of any chat rooms or forums on the Websites which permit interaction with other users are prohibited from engaging in behavior which may be construed as anticompetitive or in violation of antitrust laws. Agreements among competitors (and sometimes others) designed to restrict the free operation of markets may lead to civil liability, and may also constitute criminal conduct. Messages that might be construed as encouraging or facilitating other users to agree on prohibited topics cannot be posted on the Websites. This includes any messages about:</p>\r\n\r\n<ul>\r\n	<li>Prices</li>\r\n	<li>Significant costs</li>\r\n	<li>Discounts, or other terms of sale</li>\r\n	<li>Salaries paid to employees</li>\r\n	<li>Specific customers or vendors</li>\r\n	<li>Agreements or proposed agreements between competitors to engage in any joint activity whatsoever</li>\r\n</ul>\r\n\r\n<p>Users must interpret this prohibition broadly. An explicit agreement, or concerted action, is not necessarily required to demonstrate a violation of the antitrust laws &ndash; when combined with other evidence, statements about these topics may demonstrate a violation.</p>\r\n\r\n<p>The consequences for violating antitrust laws are severe. The maximum criminal penalty for conspiring to restrict free trade is $1 million for individuals, and from $10 million to $100 million for a corporation, with higher fines possible in certain circumstances. Individuals and corporate officers who are found guilty of price fixing or similar conduct will almost always be sentenced to imprisonment. Even if prohibited conduct does not rise to the level of criminal punishment, the government can pursue injunctive action that could put SFA members &ndash; or the SFA itself &ndash; out of business. Private plaintiffs may also sue for violations of the antitrust laws, and may be entitled to treble damages (3 times actual damages) if they are successful. The possibility of company-ending class actions is real.</p>\r\n\r\n<h2>User Content</h2>\r\n\r\n<p>If as a registered user of the Websites you post content or submit material (other than content or material on your personal dashboard), you grant the SFA a nonexclusive, royalty-free, perpetual, irrevocable, and fully sub-licensable right to use, reproduce, modify, adapt, publish, translate, create derivative works from, distribute, and display such content or material throughout the world in any media. You represent and warrant that such content or material is not obscene, threatening, defamatory, invasive of privacy, infringing on intellectual property rights of or otherwise injurious to third parties, or otherwise illegal; and that you indemnify the SFA for all claims resulting from such content or material. The SFA has the right but not the obligation to monitor, edit or remove any content or material in violation of these rules or deemed harmful or inappropriate by SFA, and to take such other action SFA deems appropriate, including giving warnings, deleting posts, banning posters, or terminating accounts. The SFA takes no responsibility and assumes no liability for any content posted by you, any other registered user, or any third party.</p>\r\n\r\n<h2>Age Limitation</h2>\r\n\r\n<p>If you are under 18, you may use the Websites only under the supervision of a parent or guardian.</p>\r\n\r\n<h2>Website Content</h2>\r\n\r\n<p>The SFA makes no representation nor has any control over the content of any other websites accessed from the Websites, including without limitation websites controlled by SFA members. A link to a non-SFA website does not mean that the SFA endorses or accepts any responsibility for the content or use of such website. On the Websites the SFA provides product information solely for the convenience of users of the Websites. Food-related information is displayed on the Websites for the convenience of users of the Websites, and the appearance of such information does not constitute the SFA&rsquo;s endorsement of any particular product, food, diet or regimen.</p>\r\n\r\n<h2>Copyright Complaints</h2>\r\n\r\n<p>The SFA and its affiliates respect the intellectual property of others. If you believe that your work has been published on the Websites in a manner that constitutes copyright infringement, please contact us at&nbsp;<a href=\"mailto:ethics@specialtyfood.com\"><strong>ethics@specialtyfood.com</strong></a>.</p>\r\n\r\n<h2>Disclaimer of&nbsp;Warranties and&nbsp;Limitation of&nbsp;Liability</h2>\r\n\r\n<p>THE SFA PROVIDES NO WARRANTY THAT ANY INFORMATION ON THE WEBSITES IS ACCURATE, COMPLETE, RELIABLE, CURRENT OR ERROR-FREE. THE WEBSITES ARE PROVIDED ON AN &ldquo;AS IS&rdquo; AND &ldquo;AS AVAILABLE&rdquo; BASIS. THE SFA MAKES NO REPRESENTATIONS OR WARRANTIES OF ANY KIND, EXPRESS OR IMPLIED, AS TO THE OPERATION OF THE WEBSITES OR THE INFORMATION, CONTENT, MATERIALS, OR PRODUCTS INCLUDED ON THE WEBSITES. YOU EXPRESSLY AGREE THAT YOUR USE OF WEBSITES IS AT YOUR SOLE RISK. TO THE FULL EXTENT PERMISSIBLE UNDER APPLICABLE LAW, THE SFA DISCLAIMS ALL WARRANTIES, EXPRESS OR IMPLIED, INCLUDING, BUT NOT LIMITED TO, IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS FOR A PARTICULAR PURPOSE. THE SFA DOES NOT WARRANT THAT THE WEBSITES, THEIRS SERVERS, OR E- MAIL SENT FROM THE SFA ARE FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS. THE SFA WILL NOT BE LIABLE FOR ANY DAMAGES OF ANY KIND ARISING FROM THE USE OF THE WEBSITES, INCLUDING, BUT NOT LIMITED TO, DIRECT, INDIRECT, INCIDENTAL, PUNITIVE, AND CONSEQUENTIAL DAMAGES.</p>\r\n\r\n<h2>Indemnification</h2>\r\n\r\n<p>You agree to indemnify and hold the SFA and any of its officers, directors, agents, and employees, harmless from any claim or demand, including reasonable attorneys&#39; fees, made by any third party due to or arising out of your activity on the Websites or your breach of these Terms and Conditions.</p>\r\n\r\n<h2>Waiver</h2>\r\n\r\n<p>The failure of the SFA to enforce any provision of these Terms and Conditions shall not be construed as a waiver or limitation of the SFA&#39;s right subsequently to enforce and compel strict compliance with every provision of these Terms and Conditions.</p>\r\n\r\n<h2>Severability</h2>\r\n\r\n<p>If any term or provision in these Terms and Conditions is found to be void, against public policy, or unenforceable by a court of competent jurisdiction and such finding or order becomes final and non-appealable, then the offending provision shall be deemed modified to the extent necessary to make it valid and enforceable. If the offending provision cannot be so modified, then the same shall be deemed stricken in its entirety, and the remainder of these Terms and Conditions shall survive with the said offending provision eliminated.</p>\r\n\r\n<h2>Governing Law and Venue</h2>\r\n\r\n<p>These Terms and Conditions are governed by the laws of the State of New York, without giving effect to its conflict of laws principles, and you and the SFA hereby submit to the exclusive jurisdiction of the state and federal courts located in the City of New York in connection with any dispute arising from these Terms and Conditions or your use of the Websites.</p>\r\n\r\n<h2>Remedies</h2>\r\n\r\n<p>You acknowledge that violation of these Terms and Conditions could cause irreparable harm for which monetary damages may be difficult to ascertain or an inadequate remedy. You therefore, agree that the SFA shall be entitled, in addition to its other rights, to seek and obtain injunctive relief for any violation of these Terms and Conditions without the filing or posting of any bond or surety.</p>'),
(64, 'about', '<p>The key to a good food website&mdash; whether it&#39;s a recipe blog, a restaurant website or selling a product&mdash; is&nbsp;<em>photography</em>. When you browse the designs below, notice how all the best designs have excellent photography.</p>\r\n\r\n<p>A good food website design don&#39;t need to be ornamental&mdash; it can be simple and straightforward in order to let the food photography shine. It&#39;s not that branding isn&#39;t important, it&#39;s just that it&#39;s best communicated through colors and logos.</p>\r\n\r\n<p>My work is supported by affiliate commissions&mdash; so I may earn a comission if you choose a website builder based on this article.</p>'),
